import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';
import Typist from 'react-typist';

class Landing extends Component {
    render() {
        return(
            <div className="landing-grid" style = {{width: '100%', margin: 'auto'}}>
                <p className="landing-grid-blank"></p>
                <Grid className="landing-grid">
                    <Cell className="cell-1" col={12}>
                        <div className="banner-text">
                            <Typist>
                            <p1> Recent Computer Science Graduate</p1>
                            </Typist>
                            <p className="banner-text-blank"></p>
                            <hr/>
                            <p className="banner-text-blank2"></p>
                            <p2>C | Java | Python | HTML | CSS</p2>
                        </div>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
